import React from "react";
import Club from "./Club";
const listClubs = (props) => {
  console.log(props.name);
  const indexClubs = props.data.map((item, i) => {
    return (
      <li key={i}>
        <h2>{props.data.name}</h2>
      </li>
    );
  });

  return <ul> {indexClubs}</ul>;
};

export default listClubs;
